import React from "react";
import { Grid } from "@material-ui/core";
import Avatar from "@material-ui/core/Avatar";
import avatar from "../../assets/images/avatar.png";

const Home = () => {
  return (
    <div style={{ width: "100%", margin: "auto" }}>
      <Grid
        style={{ marginTop: "4%" }}
        container
        justify="center"
        alignItems="center"
      >
        <Avatar
          className={classes.avatar}
          src={avatar}
          alt="Josh Padilla"
          style={{ margin: "auto" }}
        />
      </Grid>
    </div>
  );
};

export default Home;
